package nl.ncaj.theme.win9x.component

import kotlin.test.Test
import kotlin.test.assertEquals

class IcoReaderTest {

    @OptIn(ExperimentalStdlibApi::class)
    @Test
    fun loadIcoFile() {
        val file = icoComputer2File.hexToByteArray()
        val res = IcoReader.read(file)
        for (i in res.images.indices) {
            val image = res.images[i]
            assertEquals(
                icoComputer2Images[i],
                image.data.joinToString("") { it.toHexString() },
                "Image $i not decoded correctly"
            )
        }
    }
}

private val icoComputer2Images = listOf(
    "",
    "",
    "",
    "",
    "",
    "",
)

private val icoComputer2File = ""
